var mongoose = require("mongoose");

var Schema = mongoose.Schema;
var checkSchema = new Schema({
  checks: [{
    name: {
      type: String,
      default: ""
    },
    isAccessible: {
      type: Boolean,
      default: false
    },
    isChecked: {
      type: Boolean,
      default: false
    }
  }]
});
var Check = mongoose.model("Check", checkSchema);
module.exports = Check;
